    "title": "Danmachi: Is It Wrong to Try to Pick Up Girls in a Dungeon?",
    "year": "2015",
    "desc": "Als es den Göttern zu langweilig wurde, stiegen sie zu den Menschen hinab, um unter ihnen zu leben. Dafür verzichteten sie auf fast all ihre Gaben – bis auf den Segen, den sie ihren Anhängern - ihrer „Familie“ - erteilen und der diese befähigt, im Labyrinth des Dungeon gegen Monster aller Art zu kämpfen, Schätze zu sammeln, ihre Fähigkeiten zu steigern und all das zu tun, was Fantasy-Helden eben so tun. Manche Familien sind groß und mächtig, ihre Mitglieder bewunderte Heroen. Und dann gibt es da noch die Hestia-Familie, bestehend aus der Göttin Hestia und ihrem einzigen Anhänger, dem jungen Bell. Der 14jährige will ein großer Held werden, aber vor allem wünscht er sich, im Dungeon der Frau seiner Träume zu begegnen und diese zu beeindrucken. Zu dumm, dass er, als er sie endlich findet, erst einmal von ihr gerettet werden muss...",
