    "desc": "Der Bösewicht Pilaf ist immer noch auf Suche nach den Dragonballs und will damit die Weltherrschaft erlangen. Er stößt dabei auf die Black Star Dragonballs, die den Dragonballs zwar sehr ähnlich sind, jedoch auch dunkle Kräfte besitzen. Durch einen Unfall wünscht er sich von dem Drachen Shen Long, der einen Wunsch erfüllt, sobald man sieben Dragonballs zusammen hat, nicht die Weltherrschaft, sondern die Verwandlung von Son-Goku in ein Kind. Der Wunsch wird ihm erfüllt und Son-Goku schrumpft in sein junges Selbst - doch zum Glück bleibt Son-Goku der größte Teil seiner Kraft erhalten. Son-Goku versucht nun die sieben Black Star Dragonballs zu finden, um sein normales Alter zurückzuerhalten. Findet man außerdem die Black Star Dragonballs nicht innerhalb eines Jahres, wird die Erde zerstört. Bloß sind diese Dragonballs nicht alle auf der Erde, sondern irgendwo auf fremden Planeten im Universum verstreut und so beginnt die Reise …",
