    "title": "Dragon Ball",
    "year": "1986",
    "desc": "Son-Goku ist ein kleiner, aber kräftiger Junge mit einem Affenschwänzchen, der völlig unbeschwert fernab der Zivilisation im Urwald lebt. Doch sein Leben wird auf den Kopf gestellt, als eines Tages Bulma, ein Mädchen aus der Stadt, bei ihm auftaucht. Die schöne Bulma ist auf der Suche nach den sagenumwobenen Dragon Balls, denn wer alle sieben der zauberhaften Kugeln besitzt, dem erfüllt der göttliche Drache Shenlong einen Wunsch. Eine der Kugeln hat Son-Goku von seinem Großvater geerbt und Bulma hat bereits zwei weitere gefunden. Die Beiden freunden sich rasch an und beschließen, sich gemeinsam auf die Suche nach den vier verbliebenen Kugeln zu machen. Gemeinsam lernen sie viele neue Freunde kennen und müssen so manches Abenteuer bestehen, um ihr Ziel zu erreichen...",
