    "year": "2016",
    "desc": "Kazuma Satou wäre eigentlich an einem Autounfall gestorben. Doch er wacht wieder auf und findet sich bei einem hübschen Mädchen wieder, das sich selbst als Göttin vorstellt. Noch verwirrt fragt diese ihn, ob er in eine andere Welt reinkarniert werden möchte, jedoch darf er nur eine Sache mitnehmen. Das erweist sich als ziemlich schwierig, denn in seinem bisherigen Leben war er ein wahrer Hikikomori und ebenso ein Hardcore-Fan von Anime, Manga und Videospielen. Kazumi wählt schlussendlich die Göttin und damit startet er seine Reise.  Angekommen in der neuen Welt beginnt er zuerst mit der Suche nach Nahrung, Kleidung und einer sicheren Unterkunft, denn diese Welt wird von einem Dämonenkönig regiert. Kazuma möchte eigentlich nur in Frieden leben, doch die Göttin wirft ein Problem nach dem anderen auf, sodass die Dämonenarmee schon ein Auge auf ihn geworfen hat. Wird Kazuma glücklich in seiner neuen Umgebung und schafft er es, sein bisher friedliches Leben dort weiterzuführen?",
