    "title": "My Hero Academia",
    "year": "2016",
    "desc": "Der junge Izuku Midoriya hat nur einen Traum: Er möchte eines Tages ein Superheld werden - genau wie sein großes Idol All Might! Diese Seifenblase zerplatzt, als er feststellt, dass er einer der wenigen Menschen ist, die keine angeborene Spezialität - also eine besondere Fähigkeit – besitzen. Aber auch als Normalo will Izuku nicht aufgeben und bewirbt sich trotz der Lästereien seiner Mitschüler für die Aufnahmeprüfung an der Yuei-Akademie für Superhelden. Eigentlich ist sein Vorhaben zum Scheitern verurteilt, doch dann läuft er eines Tages zufällig All Might über den Weg. Gerührt von Izukus unbändigem Willen, lässt sich der größte Held aller Zeiten schließlich darauf ein, den naiven Wuschelkopf unter seine Fittiche zu nehmen. Wird das allein aber ausreichen, um gegen die starke Konkurrenz an Heldenanwärtern zu bestehen?",
