    "desc": "Was tun, wenn’s mit der Arbeit nicht klappt? Genau, man wird ein Held! Saitama ist ein stinknormaler Typ ohne Job - bis er einen kleinen Jungen vor einem Krabben-Monster retten muss. Er kann die Krabbe besiegen und beschließt daraufhin, die Jobsuche hinzuschmeißen und Hobby-Held zu werden. Nach drei Jahren hartem Training ist auf seinem Kopf zwar kein Haar mehr übrig, aber dafür erledigt er jeden Gegner mit nur einem Schlag! Von seiner eigenen Kraft gelangweilt, sehnt sich Saitama aka One Punch Man nach härteren Gegnern. Zwar zollen ihm die Leute dafür keinen Respekt, doch das geht ihm an seinem Hobby-Helden-Hintern vorbei. Ihm reicht schon der demütige Cyborg Genos, der im gleichgültigen Saitama seinen Meister sieht und ihm nun ständig an den Hacken hängt ...",
