    "desc": "Der Familienpatriarch Jacob Dutton betreibt Anfang des 20. Jahrhunderts zu Beginn der wirtschaftlichen Depression auf seiner großen Farm in Montana Viehzucht. Das Familienerbe ist der größte Landbesitz in der Gegend. Eine lange Dürre hat dazu geführt, dass es auf den Weiden kaum mehr Gras gibt und das lebensnotwendige Futter für seine Tiere knapp wird. Auch gibt es immer mehr Heuschrecken in ihrer Gegend.  Weil Banner Creighton, der die Schafhirten in der Gegend unter sich hat und zur Montana Livestock Association gehört, ebenfalls die Nahrung für seine Tiere fehlt, ihm jedoch viel weniger Land zur Verfügung steht, kommt es zwischen ihm und Jacob Dutton immer wieder zu Spannungen. Dutton jedoch würde absolut alles in seiner Macht stehende tun, um zu behalten, was ihnen gehört. Seine Frau Cara ist ebenso entschlossen und weiß eine Schrotflinte zu benutzen. Ihre Nachkommen Jack, John und zukünftig Spencer sind auf dem Land des Dutton-Clans ebenfalls vielbeschäftigt.",
