    "desc": "Als einziger Überlebender eines Schiffbruchs führt der Playboy und Milliardärssohn Oliver Queen fünf Jahre lang ein Robinson-Crusoe-Leben auf einer einsamen Insel. Er wird zum meisterhaften Bogenschützen. Nach seiner Rettung kehrt Queen charakterlich geläutert in seine Heimatstadt Starling City zurück. Er beschließt, der steigenden Kriminalitätsrate ein Ende zu setzen. Während er tagsüber in der Öffentlichkeit seine frühere Rolle als verwöhnter Snob spielt, bekämpft er nachts mit Pfeil und Bogen in geheimer Identität Verbrechen und Korruption. Zugleich versucht er, wieder bei Ex-Freundin Laurel zu landen. Deren Vater, ein Detective, betrachtet die Ankunft eines neuen Superhelden in Starling City aber mit Skepsis...",
