    "title": "Crisis Aftermath",
    "year": "2019",
    "desc": "Sie ist intelligent, resolut, bissig - und kann fast niemandem vertrauen: Überall lauern Menschen, die Katharina II. die Macht über Russland streitig machen könnten. Langzeit-Liebhaber Grigory Orlov verlangt öffentliche Anerkennung und den Status eines Ehemanns. Der ungeliebte Sohn Paul strebt ebenfalls nach Macht. Und sogar der seit seinem zweiten Lebensjahr eingesperrte Zar Iwan VI. könnte der Kaiserin noch gefährlich werden. Schließlich wurde sie selbst 1762 nur durch einen Staatstreich gegen ihren eigenen Mann zur Alleinherrscherin Russlands. Umso wichtiger ist es für sie, über alles und jeden am Hof Bescheid zu wissen. Vielleicht findet sie in dem russischen Leutnant Grigory Potemkin einen Vertrauten und ihr privates Glück? \"Sie verschlingt die Männer bei lebendigem Leibe\", warnt man ihn am Hof. Doch der abenteuerlustige Potemkin scheint der temperamentvollen Katharina gewachsen zu sein.",
