    "title": "DOTA: Dragon's Blood",
    "year": "2021",
    "desc": "Der angesehene Drachenritter Davion (Stimme im Original: Yuri Lowenthal) schwor sich einst, all das Böse der Welt den Garaus zu machen. Die Suche nach einem legendären Elderwurm beschäftigt ihn seit Jahren und lässt ihn nicht ruhen. Als er den gefährlichen Drachen endlich findet, blickt er einem alten und gebrechlichen Wesen entgegen. Für Davion ist die Tötung des alten Drachens kein Zeichen von Ruhm oder Ehre, was ihn dazu führt, den Drachen am Leben zu lassen. Doch der Elderwurm bittet um Erlösung und schenkt Davion im Gegenzug seine magischen Kräfte und Stärken. Fortan fließt in Davion Drachenblut, das ihm ungeahnte Mächte verleiht. Nachdem er den Elderwurm von seinem Leid befreit, begegnet er der eleganten Prinzessin Mirana (Lara Pulver), die ihre eigene Mission verfolgt. Durch ihre Bekanntschaft wird Davion in Ereignisse verwickelt, die er sich nie hätte ausmalen können...",
