    "desc": "Yoon Yi-Rang ist eine brillante Betrügerin mit einem IQ von 165 und außergewöhnlicher Auffassungsgabe. Mit ihrer kühlen Ausstrahlung führt sie die Bande „Confidence Man“ an, zu der auch James, ein erfahrener Trickkünstler mit Humor, und Myeong Ku-Ho, der jüngste im Team mit aufrichtiger Persönlichkeit und unbeschwertem Charme, gehören. Trotz ihrer Unterschiede verbindet sie ein gemeinsames Ziel: Betrüger zu entlarven und ihnen unrechtmäßig erworbenes Vermögen zu entziehen. Zusammen bilden sie ein Trio, das Täuschung mit Raffinesse begegnet und auf eigene Weise für Gerechtigkeit sorgt.",
