    "title": "The Legend of Korra",
    "year": "2012",
    "desc": "Die US-amerikanische Animationsserie basiert auf der Vorgängerserie „Avatar: Der Herr der Elemente“. Sie spielt in einer Fantasiewelt, in der bestimmte Menschen die Fähigkeit besitzen, jeweils eines der vier Elemente Feuer, Wasser, Luft und Erde mittels Telekinese, also durch pure Gedankenkraft, zu manipulieren. Es gibt jedoch eine Person, genannt „Avatar“, die in der Lage ist, alle vier Elemente zu beherrschen. Der Avatar ist damit verantwortlich für Beibehaltung des Gleichgewichts der Welt. Er kann in Gestalt eines Mannes oder einer Frau wiedergeboren werden und wird in der Serie von der 17-jährigen Korra verkörpert. Sie hat bereits gelernt, Wasser, Feuer und Erde zu bändigen und reist nun schließlich in die große Hauptstadt Republic City, um dort mit Lehrmeister Tenzin das Manipulieren der Luft zu trainieren. Dabei bekommt sie es mit gefährlichen Gegnern zu tun, die einen Feldzug gegen die „Elemente-Manipulierer“ führen.",
