    "id": 79501,
    "title": "Doom Patrol",
    "year": "2019",
    "desc": "Die „Doom Patrol“ ist seit 1963 bei DC Comics zu Hause und besteht aus fünf von der Gesellschaft geächteten Superhelden, die ihre Kräfte dennoch einsetzen, um Gutes zu tun. Die Gruppe besteht aus Robotman, Negative Man, Elasti-Girl und Crazy Jane. Angeführt wird das Team von dem verrückten Wissenschaftler Dr. Niles Caulder alias „The Chief“. Jeder der Helden war in einen furchtbaren Unfall verwickelt, der zwar zu den übermenschlichen Fähigkeiten führte, sie aber auch entstellt und traumatisiert zurückließ. So ist die „Doom Patrol“ nicht nur ein Superhelden-Team, sondern auch eine Art Selbsthilfegruppe. Die Fünf kämpfen für eine Welt, die eigentlich nichts mit ihnen zu tun haben will.  Die Serienhandlung von „Doom Patrol“ wird nach den Geschehnissen in „Titans“ einsetzen. So ist es Cyborg, der sich an die Helden wider Willen wendet und ihnen eine Mission überträgt, die sie nur schwer ablehnen können – obwohl sie wissen, dass ihr Leben danach nie wieder das gleiche sein wird. (Text: RD)",
