    "desc": "Als der frischgebackene Astronaut John Crichton mit seiner Raumfähre \"Farscape One\" zu einem Experimentflug ins Weltall startet, staunt er nicht schlecht, als er zufällig ein Wurmloch erzeugt und in dieses hinein gerät. Im Handumdrehen wird er an einen weit entfernten Ort des Universums verschlagen und landet dabei mitten in einer Raumschlacht. Wie sich zeigt, ist ein Gefangenenausbruch im Gange und Crichton strandet mitsamt seiner beschädigten Fähre auf dem biomechanoiden Gefangenentransporter Moya. Mit dessen Besatzung aus Verurteilten flüchtet Crichton vor den so gar nicht friedliebenden Peacekeepern in die Unerforschten Territorien, in denen zahlreiche Abenteuer, Wunder und Gefahren auf den Fremden warten. Aber auch die Peacekeeper ist die Crew der Moya mit der Flucht in die aus gutem Grund Unerforschten Territorien nicht losgeworden. Peacekeeper-Captain Crais macht Crichton für den Tod seines Bruders verantwortlich und der noch viel gefährlichere Scorpius hat es auf die Wurmlochtechnologie in Crichtons Kopf abgesehen. Der wiederum möchte, trotz der Gesellschaft der schönen und Peacekeeperin Aeryn Sun, eigentlich nur zurück nach Hause...",
    "rating": 7.866,
