    "title": "Fear the Walking Dead",
    "year": "2015",
    "desc": "Fear the Walking Dead ist ein Spin-off der Serie „The Walking Dead“ und spielt zu Beginn der Zombie-Apokalypse. Die Handlung folgt einer Patchworkfamilie in Los Angeles, die versucht, in einer sich rasch verändernden Welt zu überleben, in der die Gesellschaft zusammenbricht. Im Laufe der Serie schließen sich verschiedene Überlebende zusammen, kämpfen gegen Untote und rivalisierende Gruppen und entwickeln sich in einer zunehmend brutalen Umgebung weiter. Die Serie beleuchtet besonders die moralischen Herausforderungen und persönlichen Konflikte, die das Überleben mit sich bringt. Mit jeder Staffel verlagert sich der Schauplatz und erweitert sich das Ensemble um neue Figuren und Bedrohungen.",
