    "year": "1983",
    "desc": "Der Held He-Man vom Planeten Eternia kämpft für das Gute im Universum. Sein gefährlichster Feind ist der böse Hexenmeister Skeletor. Eigentlich verbirgt sich hinter He-Man der faule Prinz Adam, der Sohn von König Randor, der sich dank eines Zauberschwerts in den Superhelden verwandeln kann. Das Schwert hat er von der mächtigen Zauberin vom Schloss Grayskull erhalten, das es nun ebenfalls zu verteidigen gilt. An He-Mans Seite kämpfen sein bzw. Adams an sich schüchterner Tiger Cringer, der sich analog zum Herrchen in eine furchtlose Kampfkatze verwandelt, der kleine Zauberer Orko, der Waffenschmied Man-At-Arms, Stratos, der fliegen kann, der wendige Sy-Klone und andere.",
