    "desc": "In Camelot herrscht König Uther Pendragon, der Magie zum  Schwerverbrechen erklärt hat. Das Anwenden von Magie wird mit dem Tod  bestraft. Dies macht es nicht gerade leicht für den jungen Merlin, der  erst kürzlich in die Stadt gezogen ist. Er lebt beim Hofarzt Gaius, der  schnell seine magischen Fähigkeiten erkennt, ihn jedoch bei jeder  Gelegenheit in Schutz nimmt.  Es dauert nicht lange, bis Merlin zum ersten Mal Prinz Arthur  begegnet. Nach der ersten Auseinandersetzung zwischen den beiden gehen  sie sich aus dem Weg, doch als Merlin Arthurs Leben rettet, bestimmt  Uther, dass Merlin zur Belohnung Arthurs Diener wird. Zunächst sind  beide nicht sehr begeistert, aber bald entwickelt sich eine  freundschaftliche Beziehung, die beide aber oft nicht richtig wahrhaben  wollen. Merlin erfährt von einem Drachen, der unter Camelot in  Gefangenschaft lebt, dass es sein Schicksal ist, Arthur zu schützen und  ihm bei seinem vorbestimmten Weg beiseite zu stehen.",
