    "id": 62688,
    "title": "Supergirl",
    "year": "2015",
    "desc": "Im Alter von zwölf Jahren wurde Kara Zor-El – wie ihr Cousin, der spätere Superman Kal-el – von ihren Eltern bei der Zerstörung ihres Heimatplaneten Krypton in einer Raumkapsel Richtung Erde geschickt. Dabei verschlägt es sie jedoch zunächst in die ominöse Phantomzone, sodass sie erst Jahre später auf dem Planeten ankommt, wo sie wohlbehütet, doch stets im Schatten ihrer Adoptivschwester Alex, bei den Danvers aufwächst. Zwölf Jahre später arbeitet Kara als Assistentin der einflussreichen Medienunternehmerin Cat Grant  in National City. Bislang hat sie ihre übernatürlichen Kräfte, die sich ganz ähnlich wie bei ihrem berühmten Vetter entwickelt haben, geheim gehalten. Doch als es zu einem schweren Unglück kommt, beschließt sie, diese offen für das Gute einzusetzen. Unterstützt von Alex  und dem Fotografen James Olsen beginnt sie, ihre Fähigkeiten mehr und mehr zu akzeptieren, um die Menschheit künftig vor irdischen und außerirdischen Bedrohungen schützen.",
