    "desc": "Daryl wird in Frankreich angeschwemmt und kämpft darum, herauszufinden, wie er dorthin gekommen ist und warum. Die Serie verfolgt seine Reise durch ein zerrüttetes, aber widerstandsfähiges Frankreich, während er hofft, einen Weg zurück nach Hause zu finden. Die Verbindungen, die er auf seiner Reise knüpft, verkomplizieren jedoch seinen endgültigen Plan.  Will Daryl am Ende der Serie vielleicht gar nicht mehr nach Hause? Oder wird er von seinen neuen Bekanntschaften sabotiert? Erst einmal ist Daryl aber damit beschäftigt, den jungen Laurent nach Le Havre zu bringen. Dort ist der Hauptsitz der progressiven Glaubensgemeinschaft „Union de L'espoir“ oder auch „Union of Hope“. – Laurent ist für diese eine Art Jesusfigur.  Doch in Le Havre wartet auf Daryl noch die geheimnisvolle Madame Genet, die ihm an den Kragen will. Sie ist der Grund, wieso Daryl überhaupt in Frankreich gelandet ist.",
